import React from 'react';
import './App.css';

const MovieCard = ({ movie }) => {
    return (
        <div className="movie-card">
            <h2>{movie.name}</h2>
            <p>{movie.description}</p>
            <p><strong>Show Time:</strong> {movie.show_time}</p>
            <button>Book Now</button>
        </div>
    );
};

export default MovieCard;
